e8\u5206\u673a\u6784\uff0c\u5373\u5357\u4eac\u653f\u5e9c\u7684\u201c\u884c\u653f\u9662\u201d\uff0c\u5374\u63a8\u7ffb\u4e86\u8fd9\u4e2a\u653f\u5e9c\u7684\u201c\u603b\u7edf\u201d\u7684\u58f0\u660e\uff0c\u4e0d\u662f\u201c\u5fc5\u5f00\u8bda\u76f8\u89c1\uff0c\u613f\u4e0e\u5546\u8ba8\u505c\u6b62\u6218\u4e8b\u6062\u590d\u548c\u5e73\u7684\u5177\u4f53\u65b9\u6cd5\u201d\uff0c\u800c\u662f\u201c\u7acb\u5373\u5148\u884c\u65e0\u6761\u4ef6\u505c\u6218\uff0c\u5e76\u5404\u6307\u5b9a\u4ee3\u8868\u8fdb\u884c\u548c\u5e73\u5546\u8c08\u201d\u4e86\u3002\u6211\u4eec\u8981\u95ee\u5357\u4eac\u201c\u884c\u653f\u9662\u201d\u7684\u5148\u751f\u4eec\uff0c\u7a76\u7adf\u662f\u4f60\u4eec\u7684\u5efa\u8bae\u4e3a\u6709\u6548\u5462\uff0c\u8fd8\u662f\u4f60\u4eec\u7684\u201c\u603b\u7edf\u201d\u7684\u5efa\u8bae\u4e3a\u6709\u6548\u5462\uff1f\u4f60\u4eec\u7684\u201c\u603b\u7edf\u201d\u628a\u201c\u505c\u6b62\u6218\u4e8b\u6062\u590d\u548c\u5e73\u201d\u8ba4\u4e3a\u662f\u4e00\u4ef6\u4e8b\uff0c\u58f0\u660e\u5fc5\u5b9a\u5f00\u8bda\u76f8\u89c1\u613f\u4e0e\u4e2d\u5171\u5546\u8ba8\u5b9e\u73b0\u8fd9\u4ef6\u4e8b\u7684\u5177\u4f53\u65b9\u6cd5\uff1b\u4f60\u4eec\u5219\u5c06\u6218\u4e89\u4e0e\u548c\u5e73\u5206\u5272\u4e3a\u4e24\u4ef6\u4e8b\uff0c\u4e0d\u613f\u610f\u6d3e\u51fa\u4ee3\u8868\u548c\u6211\u4eec\u5546\u8ba8\u505c\u6b62\u6218\u4e89\u7684\u5177\u4f53\u65b9\u6cd5\uff0c\u800c\u5374\u5f02\u60f3\u5929\u5f00\u5730\u5efa\u8bae\u201c\u7acb\u5373\u5148\u884c\u65e0\u6761\u4ef6\u505c\u6218\u201d\uff0c\u7136\u540e\u518d\u6d3e\u4ee3\u8868\u201c\u8fdb\u884c\u548c\u5e73\u5546\u8c08\u201d\uff0c\u7a76\u7adf\u662f\u4f60\u4eec\u7684\u5efa\u8bae\u5bf9\u5462\uff0c\u8fd8\u662f\u4f60\u4eec\u201c\u603b\u7edf\u201d\u7684\u5efa\u8bae\u5bf9\u5462\uff1f\u6211\u4eec\u8ba4\u4e3a\u5357\u4eac\u4f2a\u884c\u653f\u9662\u662f\u8d8a\u51fa\u4e86\u81ea\u5df1\u7684\u804c\u6743\u7684\uff0c\u5b83\u6ca1\u6709\u8d44\u683c\u63a8\u7ffb\u4f2a\u603b\u7edf\u7684\u5efa\u8bae\u800c\u64c5\u81ea\u4f5c\u51fa\u81ea\u5df1\u7684\u65b0\u5efa\u8bae\u3002\u6211\u4eec\u8ba4